Hi, 
here is a public profile of Leon Somov.



“freedom and fear at the same time. everything gets older at every moment. it looks like i am scared of being late getting on train. but at the end of the day i listen. and i fall in love. seriously. and that is everlasting.”, - LEON SOMOV&nbsp;
2009 / march
after his studies in uk LEON SOMOV returned back home to Lithuania.&nbsp;
2009 / april
debut video “mano (remake)” and “offline” extended player LEON SOMOV &amp; JAZZU hit mtv baltic charts and were featured on “mercedes-benz tv’s” modern lounge edition.&nbsp;
2009 / may
LEON SOMOV teamed up with VAITAITAU musicians and won JAZZANOVA international remix contest for the song "i can see" leaving more that 800 contestants behind.&nbsp;
2009 / june
LEON SOMOV with talented and emotional singer JAZZU released their debut cd "updated".&nbsp;
2009 / september
LEON SOMOV &amp; JAZZU nominated as best baltic act @ mtv european music awards 2009.&nbsp;
2009 / october
LEON SOMOV released his debut solo album "no batteries no toys".&nbsp;
2009 / october&nbsp;
LEON SOMOV &amp; JAZZU won BEST BALTIC ACT @ MTV European Awards 2009&nbsp;
2009 / november
SOFIA was born!
2010 / released album LEON SOMOV & JAZZU - SCORE
2011 / won BEST ELECTRONIC BAND @ M.A.M.A Awards
2012 / won BEST MUSIC PRODUCER @ M.A.M.A Awards
2013 / Sara was born
2013 / new album coming up.
